    AccountGroup customerType = new AccountGroup();
    List<AccountGroup> listUnder = new List<AccountGroup>();
    List<AccountGroupView> articleModel;
    //GetSessionInfo
    long CompanyId = 0;
    long RoleId = 0;
    long FinancialYearId = 0;
    bool isDefult = false;
    Privilege privi = new Privilege();
    string strMenu = "AccountGroup";
    bool strAdd = true;
    bool strEdit = true;
    bool strDelete = true;
    bool strShow = true;
    protected async override void OnInitialized()
    {
        CompanyId = await sessionStorage.GetItemAsync<long>("CompanyId");
        RoleId = await sessionStorage.GetItemAsync<long>("RoleId");
        FinancialYearId = await sessionStorage.GetItemAsync<long>("FinancialYearId");
        //CheckPriviliage
        privi = priviliageRepository.PriviliageCheck(strMenu, RoleId, CompanyId);
        if (privi != null)
        {
            strAdd = privi.AddAction;
            strEdit = privi.EditAction;
            strDelete = privi.DeleteAction;
            strShow = privi.ShowAction;
            if (strShow == false)
            {
                Snackbar.Add("You dont have to privilege.", Severity.Success);
                navManager.NavigateTo("dashboard");
            }
        }
        else
        {
            strAdd = true;
            strEdit = true;
            strDelete = true;
            strShow = true;
        }
        LoadData();
        StateHasChanged();
    }
    protected void LoadData()
    {
        customerType.AccountGroupId = 0;
        customerType.AccountGroupName = "";
        customerType.GroupCode = "";
        customerType.Narration = "";
        customerType.Nature = "Assets";
        listUnder = areaservices.GetUnder();
        isDefult = false;
        articleModel = areaservices.ViewAllAccountGroup();
    }
    protected void SaveCustomerType()
    {
        if (customerType.AccountGroupName == string.Empty)
        {
            Snackbar.Add("Type Account group.", Severity.Info);
            return;
        }
        else if (customerType.GroupCode == string.Empty)
        {
            Snackbar.Add("Type Group code.", Severity.Info);
            return;
        }
        else if (customerType.Nature == string.Empty)
        {
            Snackbar.Add("Choose Nature.", Severity.Info);
            return;
        }
        else
        {
            if (customerType.AccountGroupId == 0)
            {
                if (strAdd == true)
                {
                    customerType.CompanyId = CompanyId;
                    customerType.CreatedBy = 0;
                    customerType.AddedDate = DateTime.Now;
                    customerType.AffectGrossProfit = "No";
                    bool isSave = false;
                    isSave = areaservices.InsertAccountGroup(customerType);
                    if (isSave == true)
                    {
                        Snackbar.Add("Saved Successfully.", Severity.Success);
                        LoadData();
                        navManager.NavigateTo("account/accountgrouplist");
                    }
                    else
                    {
                        Snackbar.Add("Already exists.", Severity.Success);
                        navManager.NavigateTo("account/accountgrouplist");
                    }
                }
                else
                {
                    Snackbar.Add("You dont have to priviliage.", Severity.Success);
                    navManager.NavigateTo("dashboard");
                }
            }
            else
            {

            }
        }
    }

    async Task Delete(long id)
    {
        if (strDelete == true)
        {
            bool confirmed = await JsRuntime.InvokeAsync<bool>("confirm", "Are you sure?");
            if (confirmed)
            {
                if (isDefult == false)
                {
                    bool isSave = false;
                    isSave = areaservices.DeleteaccountGroup(id);
                    if (isSave == true)
                    {
                        Snackbar.Add("Deleted Successfully.", Severity.Success);
                        LoadData();
                        navManager.NavigateTo("customertypelist");
                    }
                    else
                    {
                        Snackbar.Add("Cannot be delete. already in used.", Severity.Info);
                        navManager.NavigateTo("account/accountgrouplist");
                    }
                }
                else
                {
                    Snackbar.Add("Default data cannot be delete.", Severity.Info);
                    navManager.NavigateTo("account/accountgrouplist");
                }
            }
        }
        else
        {
            Snackbar.Add("You dont have to privilege.", Severity.Info);
            navManager.NavigateTo("dashboard");
        }
    }
    async Task Edit(long id)
    {
        customerType = await Task.Run(() => areaservices.EditAccountGroup(Convert.ToInt64(id)));
        isDefult = customerType.IsDefault;
    }

